import React from 'react';
import { Meteor } from 'meteor/meteor';
import PropTypes from 'prop-types';
import { createContainer } from 'meteor/react-meteor-data';

import { Notes } from '../api/notes';
import NoteListHeader from './NoteListHeader';

export const NoteList = (props) => {
  return (
    // <div>
    //   <NoteListHeader/>
    //   NoteList { props.notes.length }
    // </div>
    <nav className="navbar-default navbar-static-side" role="navigation">
        <div className="sidebar-collapse">

            <a className="close-canvas-menu"><i className="fa fa-times"></i></a>

            <ul className="nav" id="side-menu">
                <li className="nav-header">
                    <div className="profile-element">
                        <a>
                            <span className="clear block m-t-xs"> <strong className="font-bold">Example user</strong>
                        </span></a>
                    </div>
                    <div className="logo-element">
                        IN+
                    </div>
                </li>
                <li className="{{isActivePath regex='pageOne'}}">
                    <a href="/pageOne"><i className="fa fa-dashboard"></i> <span className="nav-label">Page one</span> </a>
                </li>          <li className="{{isActivePath regex='pageTwo'}}">
                    <a href="/pageTwo"><i className="fa fa-diamond"></i> <span className="nav-label">Page two</span> </a>
                </li>
            </ul>

        </div>
    </nav>
  );
};

NoteList.propTypes = {
  notes: PropTypes.array.isRequired
};

export default createContainer(() => {
  Meteor.subscribe('notes');
  // Setting up code to pass in the users notes as the notes prop
  return {
    notes: Notes.find().fetch()
  };
}, NoteList);
